  font-size: 3rem;
  color: #00fff0;
  animation: ${float} 3s ease-in-out infinite;
`;

const ProjectTitle = styled.h3`
  font-size: 1.5rem;
  color: #ffffff;
  margin-bottom: 1rem;
  font-weight: 600;
